import React, { Component, useEffect, useState } from 'react'
import NavBar from './NavBar'
import TablesList from './TablesList'
function Dashboard() {
    const [path, setPath] = useState("")

    const getPath = () => {
        return window.location.pathname
    }
    useEffect(() => {
        setPath(getPath())
    }, [])
    return (
        <div>
            <NavBar />
            {path === "/dashboard" ?
                <TablesList />
                :
                <Admin />
            }
        </div>
    )
}

export default Dashboard
